  `cod_producto` varchar(500) NOT NULL,
  `nom_producto` varchar(200) NOT NULL,
  `fecha_ingreso` timestamp NULL DEFAULT NULL,
  `idcategoria` int(11) NOT NULL,
  `idmarca` int(11) NOT NULL,
  `idestante` int(11) DEFAULT NULL,
  PRIMARY KEY (`idproducto`),
  KEY `fk_productos_marcas1_idx` (`idmarca`),
  KEY `fk_productos_categorias1_idx` (`idcategoria`),
